DROP TABLE IF EXISTS `tb_cidades`;
DROP TABLE IF EXISTS `tb_estados`;


CREATE TABLE IF NOT EXISTS `tb_cidades` (
  `est_id` int(11) DEFAULT NULL,
  `cid_id` int(11) DEFAULT NULL,
  `cid_nome` varchar(72) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cid_cep` varchar(8) COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS `tb_estados` (
  `est_id` int(11) DEFAULT NULL,
  `est_sigla` varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL,
  `est_nome` varchar(72) COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

SET FOREIGN_KEY_CHECKS = 0;





